(19, 5, 12, 'HITACHI CONSTRUCTION MACHINERY MPDR 3.12 & MPDR SECURITY 3.6', 'HITACHI', '&lt;p&gt;HITACHI MAINTENANCE PRO MPDR ECM DIAGNOSTIC SOFTWARE FOR HEAVY MACHINERY.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:26:00'),
(20, 5, 14, 'INTERNATIONAL DIAMOND LOGIC BUILDER â€“ 2021.08', 'INTERNATIONAL', '&lt;p&gt;DIAMOND LOGIC BUILDER PROVIDES HIGH PERFORMANCE DIAGNOSIS FOR ELECTRICAL SYSTEMS IN INTERATIONAL TRUCKS AND HIGH PERFORMANCE IC BUSES, DISPLAYS VEHICLE SIGNALS IN GRAPHIC AND TEXT FORMAT. READ AND DISPLAY THE VEHICLE FAULT DIAGNOSTIC CODES AS WELL AS THE VEHICLE FEATURES AND PARAMETERS.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:29:47'),
(21, 5, 14, 'NAVISTAR ENGINE DIAGNOSTIC â€“ 2021', 'NAVISTAR', '&lt;p&gt;NAVISTAR ENGINE DIAGNOSTICS IS A DIAGNOSTIC AND PROGRAMMING SERVICE TOOL FOR NAVISTAR&reg; ENGINES. A FULLY-FEATURED PC APPLICATION, NAVISTAR ENGINE DIAGNOSTICS IS DESIGNED TO MEET THE WIDE RANGE OF DIAGNOSTIC CHALLENGES WHEN SERVICING A MIXED TRUCK FLEET. COVERAGE INCLUDES ALL J-1939 INTERNATIONAL ELECTRONIC ENGINE SYSTEMS, ALLOWING YOU TO RUN SPECIAL TESTS, CHANGE PARAMETERS AND VIEW AND GRAPH ENGINE DATA.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:33:22'),
(22, 5, 14, 'SERVICEMAXX J1939-J1708-MWM', 'NAVISTAR', '&lt;p&gt;SERVICEMAXX IS A DIAGNOSTIC AND PROGRAMMING SERVICE TOOL FOR NAVISTAR ENGINES. A FULLY-FEATURED PC APPLICATION, SERVICEMAXX IS DESIGNED TO MEET THE WIDE RANGE OF DIAGNOSTIC CHALLENGES WHEN SERVICING A MIXED TRUCK FLEET. SERVICEMAXX IS A DIAGNOSTIC AND PROGRAMMING SERVICE TOOL FOR NAVISTAR ENGINES. COVERAGE INCLUDES LEGACY J1708 ELECTRONIC ENGINE SYSTEMS, ALLOWING YOU TO RUN SPECIAL TESTS, CHANGE PARAMETERS, VIEW AND GRAPH ENGINE DATA. IT IS THE BEST DEALER SOFTWARE FOR DIAGNOSTICS AND SERVICE INFORMATION FOR FLEETS&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:40:44'),
(23, 5, 12, 'NEXIQ ETECHNICIAN â€“ 2.4.80 [2022]', 'NEXIQ', '&lt;p&gt;DIAGNOSTIC SOFTWARE APPLICATION SERVICE TECHNICIANS WILL DEPEND ON TO KEEP TRUCKS ON THE ROAD. IN FACT, SERVICE BAY TECHNICIANS PROVIDED INPUT DURING THE DESIGN PHASE OF THE ETECHNICIAN INTUITIVE USER INTERFACE. THEIR FIRST-HAND KNOWLEDGE AND EXPERIENCE WAS INCORPORATED INTO THE ETECHNICAN DESIGN, MAKING IT BOTH EASY TO USE, AND EASY TO LEARN.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:42:23'),
(24, 5, 14, 'PACCAR ESA â€“ 5.4.3 [2021.08]', 'PACCAR', '&lt;p&gt;PACCAR ELECTRONIC SERVICE ANALYST 5.3.1.0 IS A DIAGNOSTIC TOOL THAT IS USED FOR VEHICLE DIAGNOSTICS AND FIRMWARE UPDATES. THE APPLICATION PROVIDES DATA EXCHANGE BETWEEN THE PC AND VEHICLE CONTROLLER.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:43:51'),
(25, 5, 12, 'PERKINS EST â€“ 2021B', 'PERKINS', '&lt;p&gt;DIAGNOSTIC PROGRAM, WHICH IS A PART OF THE SOFTWARE OF A &ldquo;TIPSS&rdquo; SERVICE SYSTEM. THE USER CAN USE THE PROGRAM TO COMMUNICATE WITH THE 2300/2800 PERKINS ELECTRONIC MOTORS (FG WILSON RANGE 300 &ndash; 750 KVA) AND THE FG WILSON POWERWIZARD PANEL. THIS CONNECTION IS THROUGH THE J1939 DATA LINK [FULL LICENSE]&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:45:11'),
(26, 5, 12, 'VOLVO PROSIS â€“ 8.2019', 'VOLVO', '&lt;p&gt;PROSIS PARTS CATALOG FOR VOLVO CE (CONSTRUCTION EQUIPMENT) CONTAINS A LIST OF PARTS AND ACCESSORIES FOR ALL VOLVO CONSTRUCTION MACHINERY: WHEEL LOADERS, COMPACT LOADERS, TRACK EXCAVATORS, WHEEL EXCAVATORS, COMPACT EXCAVATORS, BACKHOE LOADERS, MOTOR GRADERS, TRUCKS ARTICULATED AND MORE. IN THE CATALOG, YOU WILL FIND DETAILED VOLVO REPAIR MANUALS, ELECTRICAL AND HYDRAULIC DIAGRAMS, SPECIAL INSTRUCTIONS FOR ALL MODELS OF EQUIPMENT GUIDELINES FOR MANAGEMENT AND MAINTENANCE, ENGINE SPECIFICATIONS, TEST RESULTS OF ALL EQUIPMENT, TIMES OF PUFFS, VOLUMES FILLING AND A CATALOG OF SPECIAL TOOLS&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:46:25'),
(27, 5, 14, 'VOLVO PREMIUM TECH TOOL â€“ 2.8.92', 'VOLVO', '&lt;p&gt;TECHNICAL TOOL (TT) IT IS A TOOL THAT SUPPORTS THE REPAIR AND DIAGNOSIS PROCESS. IT WAS DEVELOPED TO MAKE REPAIR SHOP TASKS EASIER AND MORE EFFICIENT. TT CAN BE USED IN THE REPAIR SHOP, IN THE FIELD, ON THE ROAD, OR DURING TEST DRIVES. TT IS A DIAGNOSTIC APPLICATION THAT COVERS THE ENTIRE REPAIR PROCESS THROUGH THE USE OF PLUGS. WITH TT YOU CAN DIAGNOSE, TEST, CALIBRATE AND PROGRAM A PRODUCT. A PRODUCT CAN BE A VEHICLE, MOTOR, OR MACHINE. TT ALSO PROVIDES FUNCTIONS FOR UPDATING THE TOOL, COMMUNICATION WITH THE PRODUCT AND OTHER EXTERNAL APPLICATIONS. THE SET OF PLUGS, USER LICENSES AND LANGUAGES â€‹â€‹AVAILABLE IS ADJUSTABLE TO PROVIDE EACH USER WITH WHAT THEY NEED&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:47:32'),
(28, 5, 13, 'VOLVO PENTA EPC â€“ 2022.01', 'VOLVO', '&lt;p&gt;VOLVO PENTA IS THE CATALOG OF PARTS FOR MOTORS AND PONTECIA SYSTEMS FOR MARINE AND INDUSTRIAL APPLICATIONS&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:48:55'),
(29, 5, 13, 'VOLVO VODIA â€“ 5.2.50', 'VOLVO', '&lt;p&gt;DIAGNOSIS AND REPAIR OF MARINE ENGINES VOLVO PERFORMED WITH THE USE OF HARDWARE AND SOFTWARE VOLVO PENTA VODIA, ORIGINAL REPAIR INFORMATION DATABASE, THE ORIGINAL SPECIAL TOOLS, ACCESSORIES AND SYSTEM ACCESSORIES.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:50:17'),
(30, 5, 14, 'WABCO TOOLBOX + ECAS + AFTERMARKET â€“ 13.5', 'WABCO', '&lt;p&gt;WABCO TOOLBOX 13 PROVIDES COMPUTERBASED DIAGNOSTICS FOR SAE J1939, SAE J1708 AND PLC VEHICLE CONTROL SYSTEMS PRODUCTS. THE PROGRAM DISPLAYS INFORMATION FOR THE VEHICLE SYSTEM UNDER TEST, DISPLAYS ACTIVE AND STORED DIAGNOSTIC TROUBLE CODES, REPAIR INSTRUCTIONS AND ACTIVATES SYSTEM COMPONENTS, VERIFYING SYSTEM INTEGRITY&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:52:09'),
(31, 5, 14, 'ISUZU IDSS (USA) DIAGNOSTIC SERVICE SYSTEM â€“ 2020.02', 'ISUZU', '&lt;p&gt;ISUZU IDSS DIAGNOSTIC SERVICE SYSTEM.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:54:16'),
(32, 5, 14, 'HINO DIAGNOSTIC EXPLORER DX2 â€“ 1.1.21.3 [2021.02]', 'HINO', '&lt;p&gt;HINO DIAGNOSTIC PROGRAM FOR TRUCKS HINO DIAGNOSIS, CUSTOMIZATION, REPROGRAMMING, SIMULATION.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:55:27'),
(33, 5, 14, 'NAVISTAR ON COMMAND â€“ 2020', 'NAVISTAR', '&lt;p&gt;THE 2019 UPDATETO THE ISIS CD CONTINUES THE ENHANCEMENTS TO THE COMPLETELY NEW VIEWING SYSTEM WHICH WAS INTRODUCED ON THE 2019 DVD. THE ISIS DVD IS INTERNET EXPLORER COMPATIBLE. THIS WILL MAKE IT EASY TO LINK TO DIFFERENT TYPES FO INFORMATION. MUCH OF THE CONTENT HAS BEEN CLEANED UP. AFCS, RECALLS, TSIS, ENGINE DIAGNOSTIC MANUAL, ELECTRICAL CIRCUIT DIAGRAMS, ELECTRICAL SYSTEM TROUBLESHOOTING GUIDE, SERVICE MANUALS AND ETC.&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:56:29'),
(34, 5, 12, 'YANMAR EXCAVATOR EPC â€“ 2009', 'YANMAR', '&lt;p&gt;YANMAR SPARE PARTS CATALOG, PARTS BOOK, ELECTRIC DIAGRAM, HYDRAULIC DIAGRAM FOR YANMAR ENGINES, EXCAVATORS, LOADER. YANMAR SPARE PARTS CATALOGUE FEATURES: SEARCH BY MODEL, BY SERIAL NO. MACHINE, BY SERIAL NO. ENGINE. YANMAR CATALOGUE FEATURES SEARCH BY PARTS NUMBER, DESCRIPTION ETC&lt;br&gt;&lt;/p&gt;', 1, '2022-02-06 05:57:38'),
